import React from 'react';
import './styles.css';

const ContaminatedMarker = ({ data }) => {
  return (
    <div
      className={`contaminated-marker ${
        data.status === 'covid' ? 'covid' : 'suspect'
        }`}
    >
      {/* <p> {data.id} </p> */}
      {/* <p> {data.status} </p> */}
    </div>
  );
};

export default ContaminatedMarker;
